import React from 'react';
const RepoContents = ({ note }) => {
	const MainPostsWrapper = styled.div`
		margin-bottom: 30px;
	`;
	const MainPostsTitle = styled.div`
		margin-bottom: 5px;
		font-size: 14px;
	`;
	return (
		<MainPostsWrapper>
			<MainPostsTitle>운동 요약</MainPostsTitle>
			<Row
				gutter={[
					{ xs: 4, sm: 8, md: 12, lg: 16 },
					{ xs: 4, sm: 8, md: 12, lg: 16 },
				]}
			>
				{mainNotes.map((note, index) => (
					<Col span="12">
						<NoteCard key={note.id} note={note}></NoteCard>
					</Col>
				))}
			</Row>
		</MainPostsWrapper>
	);
};

export default RepoContents;
